// App.js

import JavaScriptUnminifier from './components/JavaScriptUnminifier.js';
import './App.css';
import Tabs from "./Tabs";

function App() {

    const tabData = [
        { label: "Tab 1" },
        { label: "Tab 2" },
        { label: "Tab 3" },
    ];
  return (
    <div className="App">
      <h1>HTML Stripper</h1>
      <Tabs tabs={tabData} />

      <JavaScriptUnminifier />
    </div>
  );
}

export default App;
